// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.15;
// import "hardhat/console.sol";
import "./SafeMath.sol";


contract EthPool {

    struct Balance {
        uint256 ratio; //totalPool divided by deposited amount //ratio changes wehen another user deposits
        uint256 depositedAmount;
        uint256 rewardsWhenJoined; 
    }


    using SafeMath for uint256;
    address public team;
    uint256 public totalPool;
    uint256 public totalRewards;

    mapping(address => Balance) public userBalance;

    event DummyEvent(uint256 dummy, string message);

    event RewardAdded(address indexed totalPool, string message);
    event DepositMade(address indexed depositer, uint256 amount);
    event Withdrawn(address indexed depositer, uint256 amount);

    constructor() {
        team = msg.sender;
    }

    modifier onlyTeam() {
        require(msg.sender == team, "Only the team can call this function.");
        _;
    }

    function depositRewards(uint256 value) external payable onlyTeam {
        require(value > 0, "Reward must be greater than 0");
        require(totalPool > 0, "No deposits to reward");

        totalRewards += value;

        emit RewardAdded(address(this), "Added rewards to pool!");
    }

    function deposit(uint256 value) external payable {
        require(value > 0, "Deposit must be greater than 0");

        if (userBalance[msg.sender].rewardsWhenJoined == 0) {
            userBalance[msg.sender].rewardsWhenJoined = totalRewards;
        } 

        totalPool += value;
        userBalance[msg.sender].depositedAmount += value;
        userBalance[msg.sender].ratio = SafeMath.div(userBalance[msg.sender].depositedAmount, totalPool); //change ratios every time user deposits

        emit DepositMade(msg.sender, value);
    }


    function withdraw(uint256 value) external {
        require(value > 0, "Withdrawal must be greater than 0.");

        uint256 totalAmt = balanceOf(msg.sender);
        require(totalAmt >= value, "Insufficient funds.");

        // Calculate how much of the withdrawal is deposit vs. rewards
        uint256 depositAmount = userBalance[msg.sender].depositedAmount;

        uint256 withdrawingDeposit = value;
        uint256 withdrawingRewards;

        if(value > userBalance[msg.sender].depositedAmount) {
            // If withdrawal amount is greater than the deposit, withdraw all deposit and some rewards
            withdrawingDeposit = depositAmount;
            withdrawingRewards = SafeMath.sub(value, depositAmount); //make sure rewards sufficient for this
        }

        // Adjust the user's deposited amount and rewards
        userBalance[msg.sender].depositedAmount = SafeMath.sub(userBalance[msg.sender].depositedAmount, withdrawingDeposit);
        totalPool = SafeMath.sub(totalPool, withdrawingDeposit); 
        totalRewards = SafeMath.sub(totalRewards, withdrawingRewards);


        emit Withdrawn(msg.sender, value);

    }

    function balanceOf(address user) public view returns (uint256) {
        return SafeMath.add(userBalance[user].depositedAmount, calculateRewards(user));
    }

    function calculateRewards(address user) private view returns (uint256) {
        return SafeMath.mul(SafeMath.sub(totalRewards, userBalance[user].rewardsWhenJoined), userBalance[user].ratio);
    }

    // Fallback function 
    fallback() external payable {
        revert("Please use the deposit function");
    }

    receive() external payable {
        revert("Please use the deposit function");
    }

    // Getter 
    function getPoolValue() public view returns (uint256) {
        return totalPool;
    }

    function dummy() public pure returns (uint256) {
        return 1;
    }
}

